import React, { Component } from 'react'
import './index.css'
import { Input, Select, Button } from 'antd'


const { Option } = Select;
const { TextArea } = Input;

class NovaEntrada extends Component {

  state = {
    descricao: '',
    estoque: '',
    nomeProduto: '',
    quant: '',
  }

  render() {
    return (
      <div className='div-card-entrada'>
        <div className='linhaTexto-entrada'>
          <h1 className='h1-entrada'>Nova entrada</h1>
        </div>

        <div className='linha1-entrada'>
          <div className='div-descricao-entrada'>
            <div className='div-text-entrada'>Descrição:</div>
            <TextArea
              className='input-100'
              placeholder="Digite a descrição"
              autosize={{ minRows: 2, maxRows: 4 }}
              rows={4}
              value={this.state.newDescricao}
              onChange={this.onChange}
            />
          </div>

          <div className='div-carro-tecnico'>
            <div className='div-text-tecnico'>Carro:</div>
            <Select value='UP' style={{ width: '100%' }} >
              <Option value='UP' onChange={this.onChangeSelect}>UP AYD-6220</Option>
            </Select>
          <Button className='buttonadd-marca-tecnico' type="primary" icon="plus" onClick={this.openModal} />
          </div>
        </div>
      </div>
    )
  }
}

export default NovaEntrada
